import React from 'react';
import PropType from 'prop-types';
import 'antd/dist/antd.css'

const NodeBird = ({ Component }) => {
    return (
        <div>
            <div>Main Menu</div>
            <Component />
        </div>
    )
};

NodeBird.propType = {
    Component: PropType.elementType.isRequired,
}

export default NodeBird;
